<!DOCTYPE html><html lang='ko'><head><meta charset='UTF-8'><title>컴퓨터활용능력 2급 기출 복원문제모의고사 1회</title><meta name='viewport' content='width=device-width, initial-scale=1' /><style>
  body { font-family: "맑은 고딕", system-ui, -apple-system, Segoe UI, Roboto, Arial, sans-serif; line-height: 1.55; background:#f5f7fb; margin:0; }
  .wrap { max-width: 1080px; margin: 20px auto 72px; background:#fff; border:1px solid #e6e8ef; border-radius:14px; padding:20px 24px 32px; box-shadow:0 6px 24px rgba(0,0,0,.05); }
  .header { display:flex; align-items:center; gap:14px; }
  .header img.logo { width:72px; height:72px; border-radius:50%; border:1px solid #e6e8ef; object-fit:cover; }
  h1 { margin:0; font-size:1.55rem; }
  .subtitle { color:#667089; margin-top:4px; }
  #scoreBox { margin:16px 0 16px; font-weight:800; background:#eef5ff; padding:10px 12px; border-radius:10px; }
  .info { margin: 0 0 12px; color:#3a3f4a; }
  .q { border:1px solid #eceff5; border-radius:12px; padding:12px; margin: 12px 0; }
  .q-head { font-weight:800; margin-bottom:8px; }
  .stem-img { max-width:100%; height:auto; border:1px solid #e6e8ef; border-radius:10px; margin:6px 0 8px; }
  .choices { display:grid; grid-template-columns: repeat(1, minmax(0,1fr)); gap:8px; }
  .choice { border:1px solid #e6e8ef; border-radius:10px; padding:8px; display:flex; align-items:flex-start; gap:10px; }
  .choice img { max-width:100%; height:auto; border:1px solid #e6e8ef; border-radius:8px; display:block; margin-top:6px; }
  .badge { display:inline-block; padding:2px 6px; border-radius:6px; font-size:.8rem; margin-right:8px; }
  .ok { background:#e8f8ea; color:#0e832c; border:1px solid #bee9c7; }
  .no { background:#ffeceb; color:#d11124; border:1px solid #ffd0cb; }
  .explain {
  color: #0b5fff;
  white-space: normal;
  display: inline-block;
  line-height: 1.6;
  margin-top: 6px;
}
  .answer-line { font-size:16px; font-weight:bold; margin-top:4px; margin-bottom:6px; }
  .answer-ok { color:#0a7a26; }
  .answer-no { color:#c00; }
  .controls { margin-top:12px; display:flex; gap:10px; flex-wrap:wrap; }
  button.primary { padding:10px 16px; background:#0b5fff; color:#fff; border:none; border-radius:10px; font-weight:800; cursor:pointer; }
  button.ghost { padding:10px 16px; background:#fff; color:#333; border:1px solid #ddd; border-radius:10px; cursor:pointer; }
.choice.side{display:grid;grid-template-columns:46px 1fr;align-items:flex-start}
.choice.side .opt-left{display:flex;align-items:center;gap:6px;margin-top:12px}
.choice.side .opt-num{font-weight:700}

.\n④\n인쇄\n결과물이\n번지거나\n얼룩\n자국이\n발생할\n경우\n헤드\n및\n카트리지를\n청소한다\n.\n※\n스풀에러가\n발생한\n경우\n운영체제를\n재설치"}, {"no": 16, "stem": "전자우편(E-mail)에 대한 설명으로 옳지 않은 것은?", "stem_img": null, "choices": ["여러 사람에게 동시에 같은 메일을 보낼 수 있다.", "SMTP는 메일을 보내는 데 쓴다.", "POP3는 멀티미디어 전송을 가능하게 한다.", "SMTP, MIME, POP3 등이 사용된다."], "choice_imgs": [null, null, null, null], "answer": 3, "explain": "다음\n중\n인터넷을\n이용한\n전자\n우편\n(E-mail)\n에\n관한\n설명으\n로\n옳지\n않은\n것은\n?\n①\n한\n사람이\n동시에\n여러\n사람에게\n동일한\n전자\n우편을\n보낼\n수\n있다\n.\n②\nSMTP\n는\n사용자가\n작성한\n메시지를\n상대방\n서버로\n전송하\n는\n프로토콜이다\n.\n③\nPOP3\n는\n멀티미디어\n데이터를\n메일을\n통해서\n전송가능하\n게\n하는\n프로토콜이다\n.\n④\n전자\n우편에서는\nSMTP,\nMIME,\nPOP3\n프로토콜\n등이\n사용\n된다\n.\n※\nSMTP\n:\n작성한\n전자우편을\n상대방\n서버로\n보낼\n때\n※\nPOP3\n:\n메일서버로부터\n전자우편을\n가져올\n때\n※\nMIME\n:\n멀티미디어\n데이터를\n메일을\n통해\n전송가능"}, {"no": 17, "stem": "DNS에 대한 설명으로 옳은 것은?", "stem_img": null, "choices": ["문자 도메인을 숫자 IP로 바꿔주는 서비스이다.", "인터넷을 위해 반드시 필요한 문자 주소이다.", "숫자 IP를 사람이 쓰기 쉽게 문자로 바꾼 주소 그 자체이다.", "동적인 IP를 할당해주는 프로토콜이다."], "choice_imgs": [null, null, null, null], "answer": 1, "explain": "다음\n중\nDNS\n의\n대한\n설명으로\n옳은\n것은\n?\n①\n문자로된\n도메인주소을\n숫자로된\nIP\n주소로\n바꾸어주는\n서\n비스\n②\n인터넷을\n사용하기\n위해\n반드시\n필요한\n문자로된\n주소\n③\n숫자로된\nIP\n주소를\n사용자가\n사용하기\n편리하게\n문자주소\n로\n바꾸어\n놓은\n주소\n④\n동적인\nIP\n주소를\n할당해주는\n프로토콜\n※\nDNS\n:\n문자로된\n도메인을\n숫자로된\nIP\n주소로\n번역해주는\n서비스\n※\nDHCP\n:\n동적인\nIP\n주소를\n할당해주는\n프로토콜\n911직업능력교육원\n911직업능력교육원컴퓨터활용능력\n2\n급\n기출복원문제"}, {"no": 18, "stem": "인터넷 정보·서비스의 위치, 파일명 등을 표시하는 것은?", "stem_img": null, "choices": ["DHCP", "CGI", "DNS", "URL"], "choice_imgs": [null, null, null, null], "answer": 4, "explain": "다음\n중\n인터넷에\n존재하는\n정보나\n서비스에\n대해\n접근\n방\n법\n,\n존재\n위치\n,\n좌표\n,\n파일명\n등의\n요소를\n표시하는\n것은\n?\n①\nDHCP\n②\nCGI\n③\nDNS\n④\nURL\n※\nDHCP\n:\n동적\n주소할당\n프로토콜\n※\nCGI\n:\n서버와\n응용프로그램\n사이에\n데이터를\n주고받기\n위\n한\n표준화된\n방법\n※\nDNS\n:\n문자로된\n도메인을\n숫자로된\nIP\n주소로\n번역해주는\n서비스"}, {"no": 19, "stem": "인쇄관리자에서 수행할 수 있는 기능으로 옳지 않은 것은?", "stem_img": null, "choices": ["인쇄 중 문서 일시중지/재시작", "대기 중 문서 취소", "용지방향·인쇄매수 설정", "대기 문서 순서 변경"], "choice_imgs": [null, null, null, const root = document.getElementById('quiz');

function render() {
  const root = document.getElementById('quiz');
  root.innerHTML = '';
  quiz.forEach(q => {
    const box = document.createElement('div');
    box.className = 'q';

    const head = document.createElement('div');
    head.className = 'q-head';
    const stemText = (q.stem || '').replace(/\s+/g,' ').trim();
    head.textContent = `${q.no}. ${stemText}`;
    box.appendChild(head);

    if (q.stem_img) {
      const img = document.createElement('img');
      img.src = q.stem_img;
      img.alt = '문항 ' + q.no + ' 이미지';
      img.className = 'stem-img';
      box.appendChild(img);
    }

    const choices = document.createElement('div');
    choices.className = 'choices';
    const texts = q.choices && q.choices.length === 4 ? q.choices : ["", "", "", ""];
    texts.forEach((txt, idx) => {
      const cnum = idx + 1;
      const row = document.createElement('label');
      const hasImg = q.choice_imgs && q.choice_imgs[idx];
      const imgTag = hasImg ? `<img src="${q.choice_imgs[idx]}" alt="문항 ${q.no} 보기 ${cnum}">` : '';
      const choiceText = (txt || '').replace(/\s+/g,' ').trim();

      const needsSide = (q.no === 24 || q.no === 29) && hasImg && !choiceText;
      if (needsSide) {
        row.className = 'choice side';
        row.innerHTML = `
          <div class="opt-left">
            <input type="radio" name="q${q.no}" value="${cnum}">
            <span class="opt-num">${cnum}.</span>
          </div>
          <div class="opt-right">${imgTag}</div>`;
      } else {
        row.className = 'choice';
        row.innerHTML = `
          <input type="radio" name="q${q.no}" value="${cnum}" style="margin-top:4px;">
          <div style="flex:1;">
            <div class="choice-title">${cnum}. ${choiceText}</div>
            ${imgTag}
          </div>`;
      }
      choices.appendChild(row);
    });
    box.appendChild(choices);

    const res = document.createElement('div');
    res.id = 'r' + q.no;
    box.appendChild(res);

    root.appendChild(box);
  });
}
render();


document.getElementById('submitBtn').addEventListener('click', function() {
  let correct = 0, wrong = 0, blank = 0;
  let total = quiz.length;

  quiz.forEach(q => {
    const radios = document.getElementsByName('q' + q.no);
    let picked = null;
    radios.forEach(r => { if (r.checked) picked = Number(r.value); });

    const res = document.getElementById('r' + q.no);
    const answer = q.answer;
      const explainRaw = (q.explain || '').replace(/911직업능력교육원[\s\S]*?기출복원문제/g,'').replace(/\s+/g,' ').trim();
const tmp = explainRaw.includes('※') ? explainRaw.slice(explainRaw.indexOf('※')) : (explainRaw.lastIndexOf('④') !== -1 ? explainRaw.slice(explainRaw.lastIndexOf('④')+1) : explainRaw);
const explain = tmp.replace(/※/g,'<br>※').trim();

    const circ = ["①","②","③","④"][answer - 1];
    if (picked === answer) {
      correct++;
      res.innerHTML = `<div class="answer-line answer-ok">정답: ${circ} (○)</div><div class="explain">${explain}</div>`;
    } else if (picked === null) {
      blank++;
      res.innerHTML = `<div class="answer-line answer-no">정답: ${circ} (✕)</div><div class="explain">정답은 ${answer}번 — ${explain}</div>`;
    } else {
      wrong++;
      res.innerHTML = `<div class="answer-line answer-no">정답: ${circ} (✕)</div><div class="explain">정답은 ${answer}번 — ${explain}</div>`;
    }
  });

  const rate = (correct / total * 100).toFixed(1);
  const box = document.getElementById('scoreBox');
  box.textContent = `총점: ${correct} / ${total} (정답률 ${rate}%) • 오답: ${wrong} • 미응답: ${blank}`;
});

document.getElementById('resetBtn').addEventListener('click', function() {
  document.querySelectorAll('input[type=radio]').forEach(r => r.checked = false);
  document.querySelectorAll('[id^=r]').forEach(el => el.textContent = '');
  document.getElementById('scoreBox').textContent = '제출하면 점수가 여기 표시됩니다.';
});
</script></body></html>
